let { json, year, TransactionID } = runtime.inputs();
let { done } = runtime.outputs();
let collections = lucy.currentModel().collections();

(async () => {
    try {
        const data = JSON.parse(json);
        if (!data || !Array.isArray(data) || data.length === 0) {
            throw new Error("Insert failed: Empty JSON data provided");
        }

        // First, check if any records exist for the given month and year
        const existingMonthRecord = await collections.findOne("GovernanceActivities", {
            Year: year
        }, {});

        if (existingMonthRecord && Object.keys(existingMonthRecord).length > 0) {
            runtime.error(`Records already exist for ${year}.` );
            return;
        }

        // If no records exist for the month/year, proceed with validation
        const validationErrors = [];

        // Validate all activities against ActivityMaster
        for (const activity of data) {
            const masterRecord = await collections.findOne("ActivityMaster", {
                ActivityID: activity.ActivityID,
                ActivityGroup: activity.ActivityGroup,
                ActivityCategory: activity.ActivityCategory,
                Category: "Governance"
            }, {});

            if (JSON.stringify(masterRecord) === '{}') {
                validationErrors.push(`ActivityID : ${activity.ActivityID}`);
            } else {
                activity.Year = year;
                activity.TransactionID = TransactionID;
            }
        }

        if (validationErrors.length > 0) {
            runtime.error(`Activity validation failed for ${validationErrors.join(', ')}`);
            return;
        }

        // All validations passed, insert the records
        await collections.insertMany("GovernanceActivities", data, {});
        runtime.done({ done: `Inserted ${data.length} records successfully for ${year}.` });

    } catch (error) {
        runtime.error({ done: `Error: ${error.message}` });
    }
})();

